import type { IAccount } from '@angelfish/core'
import { categoryGroups } from './category-groups'
import { institutions } from './institutions'

/**
 * Helper function to return all mock Accounts with relations populated
 *
 * @returns Array of Accounts with relations
 */
export function getAccountsWithRelations(): IAccount[] {
  return accounts.map((account) => ({
    ...account,
    categoryGroup: categoryGroups.find((cg) => cg.id === account.cat_group_id),
    institution: institutions.find((i) => i.id === account.acc_institution_id),
  }))
}

/**
 * Helper function return all mock Bank Accounts with relations populated
 *
 * @returns Array of Bank Accounts with relations
 */
export function getBankAccountsWithRelations(): IAccount[] {
  return getAccountsWithRelations().filter((account) => account.class === 'ACCOUNT')
}

